DROP TABLE IF EXISTS movies;

CREATE TABLE IF NOT EXISTS movies (
  movie_id int PRIMARY KEY NOT NULL,
  movie_year int DEFAULT NULL,
  movie_length varchar(3) DEFAULT NULL,
  movie_title varchar(69) DEFAULT NULL,
  movie_subject varchar(15) DEFAULT NULL,
  movie_actor varchar(23) DEFAULT NULL,
  movie_actress varchar(28) DEFAULT NULL,
  movie_director varchar(27) DEFAULT NULL,
  movie_popularity varchar(3) DEFAULT NULL,
  movie_awards varchar(3) DEFAULT NULL
);

